import styled from 'styled-components';

const Wrapper = styled.div`
  text-align: center;
`;

const Header = styled.p`

  @media(min-width: 1024px) {
    color: #373739;
    font-size: 54px;
    font-weight: bold;
    text-align: center;
  }
`;

const Email = styled.a`
  color: #27ace2;
  font-size: 32px;
`;

export {
  Header,
  Email
}
